(April 13, 2020) With a new ordinance, the province Emilia Romagna is confirming the following measures for Rimini, Piacenza, Medicina and Ganzanigo until May 3, 2020:

- Suspension of all production activities of goods and services by individuals and companies with the exception of agricultural, livestock and fishing, agri-food and related supply chains;

- The production of urgent services for homes and for the guarantee of the continuity of the allowed activities (for example: plumbers, electricians), those indispensable to allow mobility by using automation vehicles, are excluded from the closure obligation by way of example: mechanics, electricians, tire specialists);

- Commercial activities allowed for foodstuffs, pharmacies, bakeries, hardware stores, laundries, animal feed retailers, newsagents, fuel distributors for public transport vehicles, opticians, tobacconists, replenishment of banknotes at ATMs and Postamat;

- Only one member of the family is allowed access stores except for the need to bring minors, disabled or elderly people with them;

- All work sites are suspended with the exception of urgent ones connected with the safety of the territory;

- Professional forms are closed to the public;

- Public parks, municipal orchards, dog walking areas, concession and free beaches, areas adjacent to the sea, promenades, free-access sports areas, public and private toilets for use and playgrounds are closed to the public;

(Italy) Campania province issued ordinance n°48 on May 17, 2020:


- commercial activities, like: "personal services" (hairdressers, barbers, beauty centers ..), retail commercial activities, bars (with counter service, not yet at tables) reopen. Restaurants will open again from May 21st;

- museums and libraries reopen;

- swimming-pools and gyms are closed until May 25th;

- obligation of the outdoor masks confirmed.
